message:
Any non-zero value is considered high

I was analyzing some code I got ChatGPT to write to control the LCD and got this line: HAL_GPIO_WritePin(GPIOB, GPIO_PIN_D4, (command >> 4) & 0x01);

After considering it for a while and asking LLMs more questions, I realized that any byte with any nonzero value it in is considered high. I tested this with 0x10, 00010000 - Very amazing to read datasheets until you discover to fundamentals of firmware programming
